import { Grid, Typography ,Paper} from '@mui/material'
import React from 'react'

const Dashboard = () => {
  return (
    
    <div>
{/* WHOLE CONTAINER */}
      <Grid
      container

      spacing={1}
      direction="column"
      justifyContent="center"
      alignItems="center"
      style={{
        border:'2px solid red'
      }}>
  
  {/* FOR ZAIDO */}
        <Grid container item   
        direction="row"
      justifyContent="center"
      alignItems="center"spacing={2}>
          
          {/* box 1 */}
          <Grid item xs={6}md={3}>

            {/* paper */}
            <Paper variant="outlined" square
            sx ={{
              backgroundColor: 'lightblue',
              width:300,
              height:300
            }}/>
          </Grid>

          {/* box 2 */}
        <Grid item xs={6}md={3}>
          
          <Paper variant="outlined" square
          sx ={{
            backgroundColor: 'red',
            width:300,
            height:300
          }}/>

        </Grid>

        {/* BOX 3 */}
      <Grid item xs={6}md={3}>

          <Paper variant="outlined" square 
          sx ={{
            backgroundColor: 'green',
            width:300,
            height:300
            }}/>
          </Grid>

      {/* BOX 4 */}
     <Grid item xs={6} md={3}>

          <Paper variant="outlined" square 
          sx ={{
            backgroundColor: 'yellow',
            width:300,
            height:300
          }}/>
      </Grid>

    </Grid>




<Typography variant='h1'> Hi this is a Dashboard</Typography> 


      </Grid>



    </div>
  )
}

export default Dashboard
